"use client";

import 'svg2pdf.js';
import React from "react";
import Link from "next/link";
import { jsPDF } from 'jspdf';
import { useRef } from "react";
import { useUser } from "@clerk/nextjs";
import slugify from 'typescript-slugify';
import { useState, useEffect } from "react";
import axios, { AxiosResponse } from 'axios';
import { Label } from "@/components/ui/label";
import { Button } from "@/components/ui/button";
import { MapPin, CalendarDays } from "lucide-react";
import { useToast } from "@/components/ui/use-toast";
import { ChevronRight, Download } from "lucide-react";
import { Separator } from "@/components/ui/separator";
import generateSVGText from "@/utils/text_to_svgpath";
import { Card, CardContent, CardDescription, CardFooter, CardHeader, CardTitle } from "@/components/ui/card";

interface AttendeeData {
    Attendee_Name: string;
    Email_Address: string;
    Checked_In: string;
}

export default function Certificate() {
    const { toast } = useToast()
    const { user, isSignedIn } = useUser();
    const svgRef = useRef<SVGSVGElement | null>(null);
    const [appscriptFetchError, setAppscriptFetchError] = useState<boolean>(false);
    const [noneAttendeeName, setNoneAttendeeName] = useState<string | null>(null);
    const [attendeeName, setAttendeeName] = useState<string | null>(null);
    const [attendeeNameSVG, setAttendeeNameSVG] = useState<string | null>(null);

    const fetchData = async (targetEmail: string): Promise<AttendeeData | null> => {
        try {
            const response: AxiosResponse<{ data: AttendeeData[] }> = await axios.get(`https://script.google.com/macros/s/${process.env.NEXT_PUBLIC_SHEET_WEBVERSE_P1_E1_ID}/exec`);
            const filteredData: AttendeeData | undefined = response.data.data.find((entry: AttendeeData) => entry.Email_Address === targetEmail);
            return filteredData || null;
        } catch (error) {
            console.error('Error fetching data:', error);
            setAppscriptFetchError(true);
            return null;
        }
    };

    const downloadSvgAsPdf = (svgElementId: string, fileName: string, metadata = {}, quality = 1.5) => {
        const element = document.getElementById(svgElementId);

        if (!element) {
            console.error(`SVG element with id '${svgElementId}' not found.`);
            return;
        }

        const svgWidth = 1920;
        const svgHeight = 1337.7;

        const canvas = document.createElement('canvas');
        canvas.width = svgWidth * window.devicePixelRatio;
        canvas.height = svgHeight * window.devicePixelRatio;
        canvas.style.width = `${svgWidth}px`;
        canvas.style.height = `${svgHeight}px`;

        const ctx = canvas.getContext('2d', { alpha: false });

        if (!ctx) {
            console.error('Canvas context could not be created.');
            return;
        }
        const svgData = new XMLSerializer().serializeToString(element);
        const img = new Image();
        img.onload = function () {
            ctx.drawImage(img, 0, 0, svgWidth * window.devicePixelRatio, svgHeight * window.devicePixelRatio);
            const dataUrl = canvas.toDataURL('image/jpeg', quality);
            const doc = new jsPDF({
                orientation: svgWidth > svgHeight ? 'landscape' : 'portrait',
                unit: 'pt',
                format: [svgWidth, svgHeight]
            });
            doc.setProperties(metadata);
            doc.addImage(dataUrl, 'JPEG', 0, 0, svgWidth, svgHeight, undefined, 'FAST');
            doc.save(fileName);
        };
        img.src = 'data:image/svg+xml;base64,' + btoa(unescape(encodeURIComponent(svgData)));
    };

    const handleSvgPdfDownload = () => {
        const metadata = {
            title: `${attendeeName} Webverse Part One Event 1 Certificate`,
            author: 'Apexia',
            subject: 'Certificate',
            creator: 'Apexia',
        };
        downloadSvgAsPdf('certificate', `${slugify(attendeeName!)}_webverse_part_one_event_1_certificate.pdf`, metadata);
    };

    generateSVGText(`Attendee Name`, `/fonts/READYFORANYTHINGBB-BOLD.TTF`, 24, 305, 24, `black`, `black`).then(svgResult => {
        setNoneAttendeeName(svgResult);
    }).catch(error => {
        console.error(error);
    });

    useEffect(() => {
        const getEmailData = async () => {
            const email = user?.primaryEmailAddress?.emailAddress!;
            const data = await fetchData(email);
            if (data && data.Checked_In !== "") {
                setAttendeeName(data.Attendee_Name);
                toast({
                    title: "Data found",
                    description: `Data found for ${data.Attendee_Name}`,
                });
                generateSVGText(`${data.Attendee_Name}`, `/fonts/READYFORANYTHINGBB-BOLD.TTF`, 24, 305, 24, `black`, `black`).then(svgResult => {
                    setAttendeeNameSVG(svgResult);
                }).catch(error => {
                    console.error(error);
                });
                toast({
                    title: "Certificate generated",
                    description: `Certificate generated for ${data.Attendee_Name}`,
                });
            } else {
                if (!isSignedIn) {
                    toast({
                        variant: "destructive",
                        title: "You are not signed in",
                        description: `Please sign in to view your certificate.`,
                    });
                }
                else {
                    if (appscriptFetchError === false) {
                        toast({
                            variant: "destructive",
                            title: "Data not found",
                            description: "Data not found for the specified email.",
                        });
                    }
                    else {
                        toast({
                            variant: "destructive",
                            title: "Server is in Maintanence",
                            description: "Please try again later.",
                        });
                    }
                }
                setAttendeeNameSVG(null);
            }
        };

        getEmailData();
        // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [isSignedIn, toast, user]);

    return (
        <>
            <title>Webverse 1 | Apexia Certificate</title>
            <div className="w-full max-w-[90%] mx-auto justify-center min-h-screen">
                <div className="flex items-center">
                    <Link href="../" className="cursor-pointer">
                        <Label className="text-lg cursor-pointer underline">Apexia Certificate</Label>
                    </Link>
                    <ChevronRight />
                    <Label className="text-lg cursor-pointer underline">Webverse Part One Event 1</Label>
                </div>
                {/* Certificate Section */}
                <div className="flex my-5 max-sm:justify-center">
                    <Card className="flex max-sm:flex-col w-full justify-between">
                        <CardHeader>
                            <svg
                                width="842"
                                height="595"
                                id="certificate"
                                viewBox="0 0 842 595"
                                fill="none"
                                xmlns="http://www.w3.org/2000/svg"
                                xmlnsXlink="http://www.w3.org/1999/xlink"
                                className="pointer-events-none max-sm:w-full t max-sm:h-fit rounded-md shadow-sm shadow-black"
                            >
                                <rect width="842" height="595" fill="url(#pattern0)" />
                                <path d={`${attendeeNameSVG || noneAttendeeName}`} fill="#1A1A1A" />
                                <defs>
                                    <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
                                        <use xlinkHref="#image0_18_22" transform="scale(0.000296912 0.000420168)" />
                                    </pattern>
                                    <image id="image0_18_22" width="3368" height="2380" xlinkHref="data:image/png;base64," />
                                </defs>
                            </svg>
                        </CardHeader>
                        <div className="p-4 flex flex-col w-full max-sm:p-0">
                            <CardContent>
                                <div className="flex flex-col gap-2">
                                    <CardTitle className="flex flex-col gap-2">
                                        <Label className="flex items-center text-4xl max-sm:text-2xl">
                                            Webverse Part One Event 1
                                        </Label>
                                        <Separator />
                                    </CardTitle>
                                    <CardDescription>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2">
                                            <MapPin size={18} className="max-sm:w-4" />
                                            IT Seminar Hall, SVIT
                                        </Label>
                                    </CardDescription>
                                    <CardDescription>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2">
                                            <CalendarDays size={18} className="max-sm:w-4" />
                                            Tuesday, 12th March
                                        </Label>
                                    </CardDescription>
                                </div>
                            </CardContent>
                            <CardFooter>
                                {attendeeNameSVG && (
                                    <Button className="cursor-pointer" onClick={handleSvgPdfDownload}>
                                        <Label className="flex items-center max-sm:text-sm text-lg gap-2 cursor-pointer">
                                            Download Certificate
                                            <Download size={18} className="max-sm:w-4" />
                                        </Label>
                                    </Button>
                                )}
                            </CardFooter>
                        </div>
                    </Card>
                </div>
            </div>
        </>
    );
}